export const styles = {
    container3: {
      paddingVertical: 10,
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center',
      marginLeft: 0,
    },
    ellipse: {
      width: 166,
      height: 48,
      borderRadius: 100,
      backgroundColor: '#ECECEC',
      justifyContent: 'center',
      alignItems: 'center',
    },
    circle: {
      width: 40,
      height: 40,
      borderRadius: 100,
      backgroundColor: '#B1A4FF',
      position: 'absolute',
      left: 0,
      marginLeft: 5,
      justifyContent: 'center',
      alignItems: 'center',
    },
    spacing: {
      width: 50,
    },
    text: {
      marginLeft: 16,
      fontSize: 20,
      color: 'black',
      textAlign: 'center',
      color: '#1C1E32',
    },
    withdrawText: {
      marginRight: -10,
      lineHeight: 19.09,
      fontWeight: 54,
    },
    withdrawText2: {
      marginRight: -10,
      lineHeight: 19.09,
      fontWeight: 54,
    },
    container5: {
      flex: 1,
      flexDirection: 'row',
      justifyContent: 'space-between',
      padding: 0,
    },
    gridContainer: {
      flex: 1,
      flexDirection: 'row',
      alignItems: 'center',
      height: 100,
      margin: 5,
      borderRadius: 10,
      backgroundColor: 'lightgray',
    },
    firstLine: {
      flexDirection: 'row',
      alignItems: 'center',
      marginBottom: 10,
    },
    secondLine: {
      flexDirection: 'row',
      alignItems: 'center',
      marginTop: 20,
    },
    logo2: {
      width: 20,
      height: 20,
      marginBottom: 8,
    },
    textContainer: {
      marginLeft: 5,
    },
    gridText: {
      fontSize: 16,
      fontWeight: 'bold',
    },
    gridSubText: {
      fontSize: 12,
      color: 'gray',
      fontWeight: 'bold',
      marginLeft: 3,
    },
    value2: {
      fontSize: 10,
      fontWeight: 'bold',
    },
    button2: {
      backgroundColor: 'blue',
      borderRadius: 5,
      padding: 1,
      marginLeft: 5,
    },
    buttonValue: {
      color: 'white',
      fontSize: 10,
      fontWeight: 'bold',
    },
  };
